// import the library
import { library } from '@fortawesome/fontawesome-svg-core';

// import your icons;

import { faHome, faAlignJustify, faUsers, faUser, faDollarSign, faSearchDollar,faTools, faDoorOpen,
    faHandHoldingUsd, faWallet, faFingerprint, faHandPointUp, faUserSecret, faAt, faLock, faSortAmountDown, faUserCircle
} from "@fortawesome/free-solid-svg-icons";


library.add(
  faHome,
  faUsers,
  faAlignJustify,
  faUser,
  faDollarSign,
  faSearchDollar,
  faHandHoldingUsd,
  faWallet,
  faFingerprint,
  faHandPointUp,
  faUserSecret,
  faAt,
  faLock,
  faSortAmountDown,
  faUserCircle,
  faTools,
  faDoorOpen
  // more icons go here
);
